import React from "react";
import "header.css";

const Header = (props) => {
  return (
    <div>
      <h1>COD Warzone Stats</h1>
      <div>{props.error ? error() : null}</div>
      <form onSubmit={props.getStats}>
        <input name="gamertag" placeholder="gamertag" type="text" />
        <input name="platform" placeholder="platform" type="text" />
        <button>Get Stats</button>
      </form>
    </div>
  );
};

function error() {
  return (
    <div className="alert alert-danger mx-5" role="alert">
      Please enter your gamertag and platform(psn, battle, steam, xbl,
      uno(activision ID))
    </div>
  );
}

export default Header;
